import React from 'react'
import { Container, Row, Col, FormGroup, FormLabel, FormControl } from 'react-bootstrap'
import Select from 'react-dropdown-select'
import '../assests/App.css'
const Menu = () => {
  const options = [
    {
      value: 1,
      label: 'Leanne Graham'
    },
    {
      value: 2,
      label: 'Ervin Howell'
    }
  ];
  return (
    <div className='menu'>
        <Container>
          <label>
            State
          </label>
          <Select options={options} />
        </Container>
    </div>
  )
}

export default Menu
